This class provides a container DD instance that allows dragging of multiple child source nodes.

This class does not move the drag target nodes, but a proxy element which may contain any DOM structure you wish. The
DOM element to show in the proxy is provided by either a provided implementation of <a href='#!/api/Ext.dd.DragZone-method-getDragData'>getDragData</a>, or by
registered draggables registered with <a href='#!/api/Ext.dd.Registry'>Ext.dd.Registry</a>

If you wish to provide draggability for an arbitrary number of DOM nodes, each of which represent some application
object (For example nodes in a <a href='#!/api/Ext.view.View'>Ext.view.View</a>) then use of this class is the most efficient way to
"activate" those nodes.

By default, this class requires that draggable child nodes are registered with <a href='#!/api/Ext.dd.Registry'>Ext.dd.Registry</a>. However a
simpler way to allow a DragZone to manage any number of draggable elements is to configure the DragZone with an
implementation of the <a href='#!/api/Ext.dd.DragZone-method-getDragData'>getDragData</a> method which interrogates the passed mouse event to see if it has taken
place within an element, or class of elements. This is easily done by using the event's <a href='#!/api/Ext.event.Event-method-getTarget'>Ext.event.Event#getTarget</a> method to identify a node based on a CSS selector. For example,
to make the nodes of a DataView draggable, use the following technique. Knowledge of the use of the DataView is
required:

    myDataView.on('render', function(v) {
        myDataView.dragZone = new Ext.dd.DragZone(v.getEl(), {

    //      On receipt of a mousedown event, see if it is within a DataView node.
    //      Return a drag data object if so.
            getDragData: function(e) {

    //          Use the DataView's own itemSelector (a mandatory property) to
    //          test if the mousedown is within one of the DataView's nodes.
                var sourceEl = e.getTarget(v.itemSelector, 10);

    //          If the mousedown is within a DataView node, clone the node to produce
    //          a ddel element for use by the drag proxy. Also add application data
    //          to the returned data object.
                if (sourceEl) {
                    d = sourceEl.cloneNode(true);
                    d.id = Ext.id();
                    return {
                        ddel: d,
                        sourceEl: sourceEl,
                        repairXY: Ext.fly(sourceEl).getXY(),
                        sourceStore: v.store,
                        draggedRecord: v.getRecord(sourceEl)
                    }
                }
            },

    //      Provide coordinates for the proxy to slide back to on failed drag.
    //      This is the original XY coordinates of the draggable element captured
    //      in the getDragData method.
            getRepairXY: function() {
                return this.dragData.repairXY;
            }
        });
    });

See the <a href='#!/api/Ext.dd.DropZone'>Ext.dd.DropZone</a> documentation for details about building a DropZone which cooperates with
this DragZone.

Initializes the drag drop object's constraints to restrict movement to a certain element.

Usage:

    var dd = new Ext.dd.DDProxy("dragDiv1", "proxytest",
                   { dragElId: "existingProxyDiv" });
    dd.startDrag = function(){
        this.constrainTo("parent-id");
    };

Or you can initalize it using the <a href='#!/api/Ext.dom.Element'>Ext.dom.Element</a> object:

    Ext.get("dragDiv1").initDDProxy("proxytest", {dragElId: "existingProxyDiv"}, {
        startDrag : function(){
            this.constrainTo("parent-id");
        }
    });

An object who's property names identify the IDs of elements to be considered invalid as drag handles.
A non-null property value identifies the ID as invalid. For example, to prevent
dragging from being initiated on element ID "foo", use:

    {
        foo: true
    }

An object who's property names identify HTML tags to be considered invalid as drag handles.
A non-null property value identifies the tag as invalid. Defaults to the
following value which prevents drag operations from being initiated by `<a>` elements:

    {
        A: "A"
    }
